import { Component } from 'react'

export default class Cart extends Component {
	render() {
		const { itemMap } = this.props
		return (
			<div className="cart">
				{Object.keys(itemMap).map((id) => {
					<div>
						{itemMap[id].asset_description}
					</div>
				})}
			</div>
		)
	}
}
